lor=\'\' more_button_label=\'Dia 1\' less_button_label=\'Siguiente\' button_position=\'center\' color=\'#fa0505\'][vc_column width=\'1/1\']\r\n\r\nLlegando al Aeropuerto de Alajuela los llevamos al pueblo de Fortuna del Arenal\r\n\r\nHospedándose en el hotel Los Lagos sesort end Spa\r\n\r\nPor tres noches en este espectacular hotel ubicado muy cerca del magnífico volcán arenal\r\n\r\nDonde podrán disfrutar de las relajantes aguas termales\r\n\r\n[/vc_column][/vc_row]\r\n\r\n[vc_row row_type=\'expandable\' text_align=\'left\' background_color=\'\' border_color=\'\' more_button_label=\'Dia 2\' less_button_label=\'Siguiente\' button_position=\'center\' color=\'#fa0505\'][vc_column width=\'1/1\']\r\n\r\nTour de canopy por la mañana luego podrán disfrutar de la granja de cocodrilos, el Ranario y\r\n\r\nLa granja de hormigas a como de las piscinas de agua caliente y agua fría cena en el hotel\r\n\r\nAlmuerzo y cena en el hotel\r\n\r\n[/vc_column][/vc_row]\r\n\r\n[vc_row row_type=\'expandable\' text_align=\'left\' background_color=\'\' border_color=\'\' more_button_label=\'Dia 3\' less_button_label=\'Siguiente\' button_position=\'center\' color=\'#fa0505\'][vc_column width=\'1/1\']\r\n\r\nTour de canopy por la mañana luego podrán disfrutar de la granja de cocodrilos, el Ranario y\r\n\r\nLa granja de hormigas a como de las piscinas de agua caliente y agua fría cena en el hotel\r\n\r\nAlmuerzo y cena en el hotel\r\n\r\n[/vc_column][/vc_row]\r\n\r\n[vc_row row_type=\'expandable\' text_align=\'left\' background_color=\'\' border_color=\'\' more_button_label=\'Dia 4\' less_button_label=\'Siguiente\' button_position=\'center\' color=\'#fa0505\'][vc_column width=\'1/1\']\r\n\r\nTour de chocolate seguido por el tour de rafting\r\n\r\nClase 2 y 3 full day\r\n\r\nCena en hotel\r\n\r\n[/vc_column][/vc_row]\r\n\r\n[vc_row row_type=\'expandable\' text_align=\'left\' background_color=\'\' border_color=\'\' more_button_label=\'Dia 5\' less_button_label=\'Siguiente\' button_position=\'center\' color=\'#fa0505\'][vc_column width=\'1/1\']\r\n\r\nSaliendo hacia Monteverde  8:00 Am toda una aventura ya que este transporte te llevara\r\n\r\nAtreves del lago del Arenal llegando así al Pueblo del Bosque Nuboso de Monteverde\r\n\r\nAdemás famoso a nivel mundial por su rica flora y fauna\r\n\r\nHospedándote en el hotel  Country Loged  por tres noches\r\n\r\nTarde libre cena en el hotel\r\n\r\n[/vc_column][/vc_row]\r\n\r\n[vc_row row_type=\'expandable\' text_align=\'left\' background_color=\'\' border_color=\'\' more_button_label=\'Dia 6\' less_button_label=\'Siguiente\' button_position=\'center\' color=\'#fa0505\'][vc_column width=\'1/1\']\r\n\r\nTour  de puentes colgantes no incluye almuerzo\r\n\r\nCena en el hotel\r\n\r\n[/vc_column][/vc_row]\";s:10:\"post_title\";s:49:\"Paquete 6 noches 7 días en fortuna y Monteverde \";s:12:\"post_excerpt\";s:62:\"Conozca mas de este paquete en los desplegables a continuacion\";s:11:\"post_status\";s:7:\"publish\";s:14:\"comment_status\";s:4:\"open\";s:11:\"ping_status\";s:6:\"closed\";s:13:\"post_password\";s:0:\"\";s:9:\"post_name\";s:47:\"paquete-6-noches-7-dias-en-fortuna-y-monteverde\";s:7:\"to_ping\";s:0:\"\";s:6:\"pinged\";s:0:\"\";s:13:\"post_modified\";s:19:\"2015-04-23 21:28:41\";s:17:\"post_modified_gmt\";s:19:\"2015-04-23 21:28:41\";s:21:\"post_content_filtered\";s:0:\"\";s:11:\"post_parent\";i:0;s:4:\"guid\";s:61:\"http://www.mmexperiencecr.com/?post_type=product&#038;p=21991\";s:10:\"menu_order\";i:0;s:9:\"post_type\";s:7:\"product\";s:14:\"post_mime_type\";s:0:\"\";s:13:\"comment_count\";s:1:\"0\";s:6:\"filter\";s:3:\"raw\";}s:12:\"product_type\";s:6:\"simple\";s:13:\"\0*\0dimensions\";s:0:\"\";s:17:\"\0*\0shipping_class\";s:0:\"\";s:20:\"\0*\0shipping_class_id\";i:0;s:5:\"price\";s:4:\"1100\";}}}\";s:19:\"cart_contents_total\";d:3778;s:20:\"cart_contents_weight\";i:0;s:19:\"cart_contents_count\";i:3;s:5:\"total\";i:0;s:8:\"subtotal\";i:3778;s:15:\"subtotal_ex_tax\";i:3778;s:9:\"tax_total\";i:0;s:5:\"taxes