a:5:{s:4:\"data\";s:49:\"We are attending WordCamp Buenos Aires, Argentina\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/HiVlep1oviU/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://wpml.org/2015/05/we-are-attending-wordcamp-buenos-aires-argentina/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 May 2015 13:44:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"https://wpml.org/?p=627063\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:338:\"This Saturday, May 30th, four WPML representatives will attend Wordcamp Buenos Aires. &#160; Beda Schmid and Otto Wald, our excellent WPML Supporters will be present. Beda is currently working on the support forum for Toolset, one of our other plugins. Feel free to meet them in the event and take the opportunity to get answers [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Agnes Bury\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3837:\"<p>This Saturday, May 30th, four WPML representatives will attend <a href=\"https://buenosaires.wordcamp.org/2015/\" target=\"_blank\">Wordcamp Buenos Aires</a>.</p>\n<div id=\"attachment_627096\" style=\"width: 710px\" class=\"wp-caption alignnone\"><img class=\"wp-image-627096 size-full\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/wordcamp-ba-argentina.jpg\" alt=\"WordCamp BA official site\" width=\"968\" height=\"567\"  style=\"box-sizing: border-box; max-width: 100%; padding: 0 5px; height: auto;\" /><p class=\"wp-caption-text\">WordCamp BA official site (<a href=\"https://buenosaires.wordcamp.org/2015/\">buenosaires.wordcamp.org/2015</a>)</p></div>\n<p>&nbsp;</p>\n<div style=\"width: 200px\" class=\"wp-caption alignleft\"><img class=\"\" src=\"http://www.onthegosystems.com/wp-content/uploads/2014/12/beda1-wpcf_190x190.jpg\" alt=\"Beda Shmid (WPML Support Team)\" width=\"190\" height=\"190\" /><p class=\"wp-caption-text\">Beda Shmid (Support Team)</p></div>\n<div style=\"width: 200px\" class=\"wp-caption alignleft\"><img class=\"\" src=\"http://www.onthegosystems.com/wp-content/uploads/2015/04/otto-wpcf_190x190.jpg\" alt=\"Otto Wald (WPML Support Team)\" width=\"190\" height=\"190\" /><p class=\"wp-caption-text\">Otto Wald (WPML Support Team)</p></div>\n<p><strong>Beda Schmid</strong> and <strong>Otto Wald</strong>, our excellent WPML Supporters will be present. Beda is currently working on the support forum for <a href=\"http://wp-types.com/\" target=\"_blank\">Toolset</a>, one of our other plugins.</p>\n<p>Feel free to meet them in the event and take the opportunity to get answers for all your WordPress and Multilingual related questions. They will be happy to answer your questions.</p>\n<div class=\"clearfix\"></div>\n<div style=\"width: 200px\" class=\"wp-caption alignright\"><img class=\"\" src=\"http://www.onthegosystems.com/wp-content/uploads/2014/12/mercedes-wpcf_190x190.jpg\" alt=\"Mercedes Barreda (WPML Compatibility Team)\" width=\"190\" height=\"190\" /><p class=\"wp-caption-text\">Mercedes Barreda (WPML Compatibility Team)</p></div>\n<p><strong>Mercedes Barreda</strong> is in charge of our <a href=\"https://wpml.org/documentation/theme-compatibility/\" target=\"_blank\">WPML compatibility program</a>. If you&#8217;re a theme author and you would like to know if your public theme can be made compatible with WPML, you will be able to meet Mercedes and she will have the info you need.</p>\n<div style=\"width: 200px\" class=\"wp-caption alignleft\"><img class=\"\" src=\"http://www.onthegosystems.com/wp-content/uploads/2013/10/Laura1-wpcf_190x190.jpg\" alt=\"Laura de Figueiredo\" width=\"190\" height=\"190\" /><p class=\"wp-caption-text\">Laura de Figueiredo (OnTheGoSystems HR manager)</p></div>\n<p>You can also meet <strong>Laura de Figueiredo</strong>, our HR Manager. If interested in knowing more about our company benefits and if you&#8217;re interested in joining us, she can let you know more about our needs. You can establish a nice first contact that may lead to<a href=\"http://www.onthegosystems.com/team/\" target=\"_blank\"> job interview</a> later on.</p>\n<p><strong>See you on Saturday, in Buenos Aires!</strong></p>\n<div class=\"clearfix\"></div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=HiVlep1oviU:a5qrMvVLc_Q:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=HiVlep1oviU:a5qrMvVLc_Q:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=HiVlep1oviU:a5qrMvVLc_Q:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=HiVlep1oviU:a5qrMvVLc_Q:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=HiVlep1oviU:a5qrMvVLc_Q:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=HiVlep1oviU:a5qrMvVLc_Q:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/HiVlep1oviU\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://wpml.org/2015/05/we-are-attending-wordcamp-buenos-aires-argentina/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wpml.org/2015/05/we-are-attending-wordcamp-buenos-aires-argentina/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"This week compatible – Unheavy, Amalie, rtMedia Kaltura &amp; Photo Watermark\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/lziGHYfNvlU/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"https://wpml.org/2015/05/this-week-compatible-unheavy-amalie-rtmedia-kaltura-photo-watermark/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 May 2015 13:16:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Compatibility Bulletin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"https://wpml.org/?p=624340\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:336:\"Today we are happy to announce that we have 2 themes and 2 plugins to add to our compatibility list. The themes are Unheavy, Amalie, and the plugins are rtMedia Kaltura, rtMedia Photo Watermark If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5080:\"<p>Today we are happy to announce that we have 2 themes and 2 plugins to add to our compatibility list. The themes are <a title=\"Unheavy\" href=\"http://themeforest.net/item/unheavy-multipurpose-responsive-wordpress-theme/10826913\">Unheavy</a>, <a title=\"Amalie\" href=\"http://www.anarieldesign.com/themes/personal-blog-wordpress-theme/\">Amalie</a>, and the plugins are <a title=\"rtMedia Kaltura\" href=\"https://rtcamp.com/products/rtmedia-kaltura-add-on/\">rtMedia Kaltura</a>, <a title=\"rtMedia Photo Watermark\" href=\"https://rtcamp.com/products/rtmedia-photo-watermark/\">rtMedia Photo Watermark</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title=\"Multilingual Ready Themes \" href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a title=\"Multilingual Ready Plugins \" href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title=\"Achieving WPML compatibility for your themes and plugins\" href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Unheavy theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/unheavy-multipurpose-responsive-wordpress-theme/10826913\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/unheavy.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Unheavy is a multi-purpose customizable theme that can be used for a variety of business types.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/unheavy-multipurpose-responsive-wordpress-theme/10826913\" target=\"_blank\">Purchase Unheavy theme</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Amalie theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://www.anarieldesign.com/themes/personal-blog-wordpress-theme/\"><img src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/amalie.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Clean and simple theme built on 2015 theme as a base, can serve for many purposes.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://www.anarieldesign.com/themes/personal-blog-wordpress-theme/\">Purchase Amalie theme</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">rtMedia Kaltura add-on Plugin</h2>\n<p style=\"text-align: center;\"><a href=\"https://rtcamp.com/products/rtmedia-kaltura-add-on/\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/kaltura.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>The Kaltura Add-on automatically converts videos uploaded with rtMedia. It converts many popular audio and video formats to HTML5 supported MP3 and MP4 files.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"https://rtcamp.com/products/rtmedia-kaltura-add-on/\">Purchase rtMedia Kaltura add-on plugin</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">rtMedia Photo Watermark plugin</h2>\n<p style=\"text-align: center;\"><a href=\"https://rtcamp.com/products/rtmedia-photo-watermark/\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/watermark.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>rtMedia Photo Watermark add-on let you watermarked or copyright your uploaded photos.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"https://rtcamp.com/products/rtmedia-photo-watermark/\">Purchase rtMedia Photo Watermark plugin</a></p>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=lziGHYfNvlU:GVuSR_sR7BM:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=lziGHYfNvlU:GVuSR_sR7BM:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=lziGHYfNvlU:GVuSR_sR7BM:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=lziGHYfNvlU:GVuSR_sR7BM:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=lziGHYfNvlU:GVuSR_sR7BM:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=lziGHYfNvlU:GVuSR_sR7BM:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/lziGHYfNvlU\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://wpml.org/2015/05/this-week-compatible-unheavy-amalie-rtmedia-kaltura-photo-watermark/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"https://wpml.org/2015/05/this-week-compatible-unheavy-amalie-rtmedia-kaltura-photo-watermark/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"Build a multilingual site with the Divi theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/nhkzEPCud0g/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://wpml.org/2015/05/build-a-multilingual-site-with-the-divi-theme/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 May 2015 12:34:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Tutorials\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"https://wpml.org/?p=624083\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:325:\"Divi is a popular multipurpose WordPress theme. Divi comes with a powerful page builder, its design is responsive, and it has many built-in layouts you can use. It also features a robust theme option. In this tutorial, we’ll show you how to set Divi and WPML. The end result In the following short screencast, you [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:10982:\"<p><a href=\"http://www.elegantthemes.com/gallery/divi/\" target=\"_blank\">Divi</a> is a popular multipurpose WordPress theme. Divi comes with a powerful page builder, its design is responsive, and it has many built-in layouts you can use. It also features a robust theme option. In this tutorial, we’ll show you how to set Divi and <a href=\"https://wpml.org/\" target=\"_blank\">WPML</a>.</p>\n<h3>The end result</h3>\n<p>In the following short screencast, you can see how nicely Divi will work with WPML; then, we’ll discuss how this was achieved.</p>\n<p><iframe width=\"500\" height=\"375\" src=\"https://www.youtube.com/embed/2UMxDOZN9Uw?feature=oembed\" frameborder=\"0\" allowfullscreen></iframe></p>\n<h3>Getting started</h3>\n<p>These are the main steps you need to follow to get started:</p>\n<ol>\n<li>Install and activate <a href=\"http://www.elegantthemes.com/gallery/divi/\" target=\"_blank\">Divi</a> theme.</li>\n<li>Install and activate the WPML plugins (WPML Multilingual CMS, WPML String Translation, WPML Translation Management).</li>\n<li>Set up WPML from WPML &gt; Languages. See our <a href=\"https://wpml.org/documentation/getting-started-guide/\">WPML Getting Started Guide</a> for complete reference.</li>\n</ol>\n<h3>Working with Divi’s Page Builder</h3>\n<p>The Divi theme uses the built-in Elegant Themes Page Builder framework based on shortcode usage. Each template is actually a Layout custom post type.</p>\n<p>The first thing you need to know when starting with a theme such as Divi (a theme using a page builder system) and WPML is that there is a recommended workflow for translating page builders or visual composers with WPML; we recommend you read thoroughly this short tutorial:<br />\n<a href=\"https://wpml.org/2014/06/use-visual-composers-page-builders-wpml/\">How to use visual composers &amp; page builders with WPML</a></p>\n<p>There is another workflow you can use; this one is a bit more complicated, but gives you the advantage of translating more quickly when you have many pages that use the same layout. For this workflow, we recommend that you read the <a href=\"https://wpml.org/documentation/translating-your-contents/using-the-translation-editor/\" target=\"_blank\">WPML Translation Management guide</a> (steps described here are using WPML 3.2 beta):</p>\n<ol>\n<li>Go to WPML &gt; Translation Management &gt; Multilingual Content Setup.</li>\n<li>Choose Custom Types &gt; Mark Layouts as &#8220;Translate&#8221;</li>\n<li>Create posts or pages in the original language.</li>\n<li>Go to Translation Management &gt; Translation Dashboard. Mark the required posts and click Add to Translation basket (make sure the &#8220;Translate&#8221; default option is chosen).</li>\n<li>Go to the Translation Basket tab (still in Translation Management).</li>\n<li>Send the desired items for translation; there is a Send all items to translation button.</li>\n<li>Go to WPML &gt; Translation. Click Take this and edit.</li>\n<li>Now you have the complete strings included in this post/page and you can go over all of them in one place, translate, mark as &#8220;Translation complete&#8221;, and save.</li>\n</ol>\n<ul>\n<li>Note that using this method, you can translate prebuilt Divi layouts or ones you created and saved to be used for many pages, making your translation work a lot faster.</li>\n</ul>\n<div id=\"attachment_624210\" style=\"width: 310px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/Screen-Shot-2015-05-22-at-12.32.39.png\"><img class=\"size-medium wp-image-624210\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/Screen-Shot-2015-05-22-at-12.32.39-300x107.png\" alt=\"Divi theme and WPML\" width=\"300\" height=\"107\" /></a><p class=\"wp-caption-text\">Multilingual Content Divi</p></div>\n<h3>Translate theme strings</h3>\n<p>Divi comes with many strings you might want to translate. You can complete any missing translations using WPML’s String Translation add-on. If some strings are missing, follow the <a href=\"https://wpml.org/documentation/getting-started-guide/theme-localization/\">instructions for Theme and Plugin Localization</a></p>\n<p>Go to WPML &gt; Theme and Plugin Localization, and click Scan the theme for strings. Note that you can easily filter for the right strings in the context scroll down; for Divi, filter on &#8220;Divi&#8221;. The results should resemble this:</p>\n<div id=\"attachment_607762\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/04/8168562.png\"><img class=\"wp-image-607762 size-thumbnail\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/04/8168562-150x67.png\" alt=\"Enable theme localization\" width=\"150\" height=\"67\" /></a><p class=\"wp-caption-text\">Enable theme localization</p></div>\n<div id=\"attachment_611115\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8168574.png\"><img class=\"wp-image-611115 size-thumbnail\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8168574-150x113.png\" alt=\"Theme scanning results\" width=\"150\" height=\"113\" /></a><p class=\"wp-caption-text\">Theme scanning results</p></div>\n<p>As you can see now (for example), you can translate the built-in contact form labels. Simply search for strings inside the “theme Divi” context.</p>\n<div id=\"attachment_611154\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169061.png\"><img class=\"wp-image-611154 size-thumbnail\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169061-150x71.png\" alt=\"Translating theme strings\" width=\"150\" height=\"71\" /></a><p class=\"wp-caption-text\">Translating theme strings</p></div>\n<div id=\"attachment_611110\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169185.png\"><img class=\"size-thumbnail wp-image-611110\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169185-150x73.png\" alt=\"Divi contact form\" width=\"150\" height=\"73\" /></a><p class=\"wp-caption-text\">Divi contact form</p></div>\n<h3>Translate theme options</h3>\n<p>There are a few admin texts you can translate, such as the SEO settings coming from the theme options. You’ll find those strings registered and ready for translation. Other theme settings should be synchronized nicely between languages; see &#8220;Synchronizing content between languages&#8221;, below.</p>\n<div id=\"attachment_611087\" style=\"width: 158px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169349.png\"><img class=\"size-thumbnail wp-image-611087\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169349-148x150.png\" alt=\"Divi SEO settings\" width=\"148\" height=\"150\" /></a><p class=\"wp-caption-text\">Divi SEO settings</p></div>\n<div id=\"attachment_611088\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169486.png\"><img class=\"wp-image-611088 size-thumbnail\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169486-150x66.png\" alt=\"Registered theme options\" width=\"150\" height=\"66\" /></a><p class=\"wp-caption-text\">Registered theme options</p></div>\n<h3>Add language switcher</h3>\n<p>The WPML language switcher can be added as a menu item, as a widget, or in the theme footer. Basic CSS styling should fit well. If not, you can customize the appearance using the WPML built-in CSS editor.</p>\n<div id=\"attachment_611090\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169364.png\"><img class=\"size-thumbnail wp-image-611090\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169364-150x64.png\" alt=\"Language switcher\" width=\"150\" height=\"64\" /></a><p class=\"wp-caption-text\">Language switcher</p></div>\n<div id=\"attachment_611097\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169396.png\"><img class=\"size-thumbnail wp-image-611097\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169396-150x113.png\" alt=\"Language switcher settings\" width=\"150\" height=\"113\" /></a><p class=\"wp-caption-text\">Language switcher settings</p></div>\n<div id=\"attachment_611098\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169664.png\"><img class=\"size-thumbnail wp-image-611098\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169664-150x79.png\" alt=\"WPML CSS editor\" width=\"150\" height=\"79\" /></a><p class=\"wp-caption-text\">WPML CSS editor</p></div>\n<h3>Synchronizing content between languages</h3>\n<p>Multilingual Content Setup preferences are already set using the theme’s <a href=\"https://wpml.org/documentation/support/language-configuration-files/\">WPML XML config file</a>.</p>\n<p>We are using the WPML repository for that purpose; we are now on the safe side, as seen in WPML &gt; Translation Management &gt; Multilingual Content Setup &gt; Custom Fields Translation.</p>\n<div id=\"attachment_611100\" style=\"width: 153px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169481.png\"><img class=\"wp-image-611100 size-thumbnail\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169481-143x150.png\" alt=\"Multilingual Content Setup\" width=\"143\" height=\"150\" /></a><p class=\"wp-caption-text\">Multilingual Content Setup</p></div>\n<div id=\"attachment_611102\" style=\"width: 160px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169525.png\"><img class=\"wp-image-611102 size-thumbnail\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/8169525-150x130.png\" alt=\"Translation Dashboard\" width=\"150\" height=\"130\" /></a><p class=\"wp-caption-text\">Translation Dashboard</p></div>\n<p><strong>Versions used:</strong></p>\n<ul>\n<li>WordPress 4.2.2</li>\n<li>WPML 3.1.9.x and higher</li>\n<li>Divi theme 2.3.2</li>\n</ul>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=nhkzEPCud0g:38cueWvzA4Q:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=nhkzEPCud0g:38cueWvzA4Q:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=nhkzEPCud0g:38cueWvzA4Q:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=nhkzEPCud0g:38cueWvzA4Q:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=nhkzEPCud0g:38cueWvzA4Q:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=nhkzEPCud0g:38cueWvzA4Q:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/nhkzEPCud0g\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wpml.org/2015/05/build-a-multilingual-site-with-the-divi-theme/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wpml.org/2015/05/build-a-multilingual-site-with-the-divi-theme/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"This week compatible – Chillout, Okean, Spider, rtMedia Instagram\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/K5N3G9oAlhM/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://wpml.org/2015/05/this-week-compatible-chillout-okean-spider-rtmedia-instagram/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 15 May 2015 20:25:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Compatibility Bulletin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"https://wpml.org/?p=619886\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:316:\"Today we are happy to announce that we have 3 themes and 1 plugin to add to our compatibility list. The themes are Chillout, Okean, Spider, and the plugin is rtMedia Instagram If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5202:\"<p>Today we are happy to announce that we have 3 themes and 1 plugin to add to our compatibility list. The themes are <a title=\"Chillout\" href=\"http://themeforest.net/item/chillout-parallax-onepage-wordpress-theme-/9825415\">Chillout</a>, <a title=\"Okean\" href=\"http://themeforest.net/item/okean-multipurpose-minimal-multiscroll-blogportfolio-theme/10131493\">Okean</a>, <a title=\"Spider\" href=\"http://themeforest.net/item/spider-flat-creative-portfolio-wordpress-theme/8923142\">Spider</a>, and the plugin is <a title=\"rtMedia Instagram\" href=\"https://rtcamp.com/products/rtmedia-instagram/\">rtMedia Instagram</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title=\"Multilingual Ready Themes \" href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a title=\"Multilingual Ready Plugins \" href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title=\"Achieving WPML compatibility for your themes and plugins\" href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Chillout theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/chillout-parallax-onepage-wordpress-theme-/9825415\"><img class=\"aligncenter size-full wp-image-340493\"  src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/chillout.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Chillout is a WordPress Theme for everyone who likes minimalism and clarity. It will perfectly work out as a private and corporate website but also as a portfolio.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/chillout-parallax-onepage-wordpress-theme-/9825415\" target=\"_blank\">Purchase Chillout theme</a>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Okean theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/okean-multipurpose-minimal-multiscroll-blogportfolio-theme/10131493\"><img src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/okean.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Okean is a HTML5/CSS3/Bootstrap optimized Parallax powered, responsive theme perfect for multi-purpose blog themes. It’s also perfect for Minimal Portfolio. WPML is also supported by default.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/okean-multipurpose-minimal-multiscroll-blogportfolio-theme/10131493\">Purchase Okean theme</a>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Spider theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/spider-flat-creative-portfolio-wordpress-theme/8923142\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/spider.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Flat, creative portfolio WordPress Theme for agency business or creative people.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/spider-flat-creative-portfolio-wordpress-theme/8923142\">Purchase Spider theme</a>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">rtMedia Instagram plugin</h2>\n<p style=\"text-align: center;\"><a href=\"https://rtcamp.com/products/rtmedia-instagram/\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/rtinstagram.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>rtMedia Instagram adds Instagram like effects to rtMedia.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"https://rtcamp.com/products/rtmedia-instagram/\">Purchase rtMedia Instagram plugin</a>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=K5N3G9oAlhM:FICjgjOSCWE:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=K5N3G9oAlhM:FICjgjOSCWE:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=K5N3G9oAlhM:FICjgjOSCWE:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=K5N3G9oAlhM:FICjgjOSCWE:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=K5N3G9oAlhM:FICjgjOSCWE:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=K5N3G9oAlhM:FICjgjOSCWE:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/K5N3G9oAlhM\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://wpml.org/2015/05/this-week