ta\";s:26:\"https://wpml.org/?p=615132\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:310:\"Today we are happy to announce that we have 2 themes and 1 plugin to add to our compatibility list. The themes are HG Restaurant, Reviver, and the plugin is Slider Image If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4644:\"<p>Today we are happy to announce that we have 2 themes and 1 plugin to add to our compatibility list. The themes are <a title=\"HG Restaurant\" href=\"http://themeforest.net/item/hg-restaurant-responsive-wordpress-theme/9910041\">HG Restaurant</a>, <a title=\"Reviver\" href=\"http://themeforest.net/item/reviver-multipurpose-responsive-wordpress-theme/10257595\">Reviver</a>, and the plugin is <a title=\"Slider Image\" href=\"https://wordpress.org/plugins/slider-image/\">Slider Image</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title=\"Multilingual Ready Themes \" href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a title=\"Multilingual Ready Plugins \" href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title=\"Achieving WPML compatibility for your themes and plugins\" href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">HG Restaurant theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/hg-restaurant-responsive-wordpress-theme/9910041\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/HG.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p> HG Restaurant is an attractive and easy-to-use responsive WordPress theme created especially for restaurants, bakeries, bars and coffee shops.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/hg-restaurant-responsive-wordpress-theme/9910041\" target=\"_blank\">Purchase HG Restaurant theme</a>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Reviver theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/reviver-multipurpose-responsive-wordpress-theme/10257595\"><img src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/reviver.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Reviver is an Ultimate WordPress + Woocommerce Theme that is extremely customizable, easy to use and fully responsive. Suitable for every type of business, portfolio, blog and ecommerce sites. Great as a starting point for your custom projects. Reviver includes 15+ layouts and skins and its very beautiful on mobile devices.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/reviver-multipurpose-responsive-wordpress-theme/10257595\">Purchase Reviver theme</a>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Slider Image plugin</h2>\n<p style=\"text-align: center;\"><a href=\"https://wordpress.org/plugins/slider-image/\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/slider.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Huge-IT Slider is a quick and easy way to add custom sliders to the WordPress websites (both to templates and posts/pages). The slider allows having unlimited amount of images with their titles and descriptions.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"https://wordpress.org/plugins/slider-image/\">Download Slider Image plugin</a>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=yM3XdieylkY:P5UsaYrybGU:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=yM3XdieylkY:P5UsaYrybGU:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=yM3XdieylkY:P5UsaYrybGU:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=yM3XdieylkY:P5UsaYrybGU:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=yM3XdieylkY:P5UsaYrybGU:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=yM3XdieylkY:P5UsaYrybGU:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/yM3XdieylkY\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\