"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:349:\"We&#8217;re ready with a Release Candidate for WPML 3.2. An RC, besides sounding nice, also means that we&#8217;re almost ready to push this update to everyone. In fact, we&#8217;re moving to WPML 3.2 on some of our own sites. Since previous betas, the content of WPML 3.2 hasn&#8217;t changed. In this update, we&#8217;ve further improved [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amir\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5334:\"<p><strong>We&#8217;re ready with a Release Candidate for WPML 3.2. An RC, besides sounding nice, also means that we&#8217;re almost ready to push this update to everyone. In fact, we&#8217;re moving to WPML 3.2 on some of our own sites.</strong></p>\n<p>Since <a href=\"https://wpml.org/2015/02/wpml-3-2-first-beta/\">previous betas</a>, the content of WPML 3.2 hasn&#8217;t changed.</p>\n<p>In this update, we&#8217;ve further improved performance, closed remaining issues and updated taxonomy translation and String scanning.</p>\n<h2>Taxonomy Translation News</h2>\n<p>WPML 3.2 adds a new admin screen (tab under the Taxonomy Translation) to synchronize the hierarchies of taxonomies. Previously, this task was done automatically, as you translate. The problem is, it was hard to control what it does and what you get.</p>\n<p>The new taxonomy hierarchy sync lets you set the same hierarchies for taxonomy for all languages. It works by:</p>\n<ol>\n<li>Selecting the language to use as reference (previously, this was assumed to be the site&#8217;s default language)</li>\n<li>Seeing what changes will happen to the taxonomy trees in all translated languages</li>\n<li>Applying these changes</li>\n</ol>\n<p>We separated this from the normal &#8216;content translation&#8217; workflow to (greatly) improve performance, accuracy and control. Most sites that use complex taxonomy hierarchies will usually edit the taxonomy tree a lot less than editing posts. From our experience, the taxonomy tree is a lot like the site&#8217;s menu. You update it once in a while.</p>\n<div id=\"attachment_612578\" style=\"width: 310px\" class=\"wp-caption alignnone\"><a href=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/taxonomy-translation-1.png\"><img src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/taxonomy-translation-1-300x130.png\" alt=\"Taxonomy hierarchy sync in WPML 3.2\" width=\"300\" height=\"130\" class=\"size-medium wp-image-612578\" /></a><p class=\"wp-caption-text\">Taxonomy hierarchy sync in WPML 3.2</p></div>\n<p>The new taxonomy sync reads the entire tree and adjusts all languages together. It&#8217;s way more accurate than what we ran in previous WPML versions. To avoid this from running on every translation job, we allow you to run it only when you want. This helps reduce load and puts you in control over the taxonomy of your site.</p>\n<h2>Improved String Scanning in Plugins and Themes</h2>\n<p>WPML 3.2 greatly improves the accuracy of scanning plugins and themes for translatable strings. Now, we also register strings under a slightly different context. No fear, when you upgrade, WPML will check if you have strings with the &#8216;old&#8217; contexts. If so, you will see a message about how to update. The update process will move strings to the new context, make sure that all strings in the code are available for translation and also clean up &#8216;phantom&#8217; strings (untranslated strings, no longer in use).</p>\n<h2>Yes, Better Performance</h2>\n<p>During this entire development cycle, we test WPML&#8217;s load on your server together with every change we make. Our goal is to cut any fat that we see and make sure that both CPU load and DB queries go down.</p>\n<p>This release candidate is no exception. We managed to find pockets of queries which could be eliminated. As a result, our testing shows superior performance over production and previous WPML 3.2 dev versions. Instead of boasting with numbers, we leave this to you to evaluate.</p>\n<h2>Other Changes in This Update</h2>\n<ul>\n<li>Fixed compatibility issues with Windows servers</li>\n<li>Fixed email notifications</li>\n<li>Fixed issues with WPSEO sitemaps when using languages in domain</li>\n<li>Updated localized strings translations</li>\n<li>Several other bug fixes</li>\n<li>Improved API and its documentation</li>\n<li>Improved compatibility with Gravity forms</li>\n</ul>\n<h2>Download</h2>\n<p>This version of WPML is only available from your <a href=\"https://wpml.org/account/\">WPML account</a>. Log in and click on Downloads. Download the CMS Beta package and unzip it. This ZIP contains ZIP files of all of WPML&#8217;s components.</p>\n<p>WPML 3.2 has already completed a round of QA. Now, after all recent changes, we&#8217;re starting another full QA cycle. We expect to release the final version in two weeks from now.</p>\n<h2>Feedback?</h2>\n<p>We&#8217;d love to hear your opinion. For questions, suggestions and ideas, leave your comments here. To report technical problems (and get help from our supporters), please use our <a href=\"https://wpml.org/forums/forum/english-support/\">technical support forum</a>.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=3fDubQ-YRKQ:ObbA4Q4doNY:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=3fDubQ-YRKQ:ObbA4Q4doNY:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=3fDubQ-YRKQ:ObbA4Q4doNY:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=3fDubQ-YRKQ:ObbA4Q4doNY:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=3fDubQ-YRKQ:ObbA4Q4doNY:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=3fDubQ-YRKQ:ObbA4Q4doNY:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/3fDubQ-YRKQ\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://wpml.org/2015/05/wpml-3-2-release-candidate/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"11\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://wpml.org/2015/05/wpml-3-2-release-candidate/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"This week compatible – MH Magazine, LSX, Loma, Nice Hotel\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/17r2Og6jT7A/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://wpml.org/2015/05/this-week-compatible-mh-magazine-lsx-loma-nice-hotel/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 01 May 2015 18:07:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Compatibility Bulletin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"https://wpml.org/?p=610415\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:320:\"Today we are happy to announce that we have 4 themes to add to our compatibility list. The themes are MH Magazine, LSX, Loma, Nice Hotel If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready Themes Multilingual Ready Plugins Also, if [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4703:\"<p>Today we are happy to announce that we have 4 themes to add to our compatibility list. The themes are <a title=\"MH Magazine\" href=\"http://www.mhthemes.com/\">MH Magazine</a>, <a title=\"LSX\" href=\"https://www.lsdev.biz/portfolio/lsx/\">LSX</a>, <a title=\"Loma\" href=\"http://themeforest.net/item/loma-the-ultimate-wp-blog-theme/9930474\">Loma</a>, <a title=\"Nice Hotel\" href=\"http://themeforest.net/item/nice-hotel-wordpress-theme/2661854\">Nice Hotel</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title=\"Multilingual Ready Themes \" href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a title=\"Multilingual Ready Plugins \" href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title=\"Achieving WPML compatibility for your themes and plugins\" href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">MH Magazine theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://www.mhthemes.com/\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/mh.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Theme for online magazines, dynamic news websites and other editorial related projects.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://www.mhthemes.com/\" target=\"_blank\">Purchase MH Magazine theme</a>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">LSX theme</h2>\n<p style=\"text-align: center;\"><a href=\"https://www.lsdev.biz/portfolio/lsx/\"><img src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/lsx.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>LSX is a clean, modern, minimal and fully responsive parent theme. This theme is ideal for developers looking for a Bootstrap parent theme.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"https://www.lsdev.biz/portfolio/lsx/\">Download LSX theme</a>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Loma theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/loma-the-ultimate-wp-blog-theme/9930474\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/loma.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Loma is a responsive WordPress blog theme.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/loma-the-ultimate-wp-blog-theme/9930474\">Purchase Loma theme</a>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Nice Hotel theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/nice-hotel-wordpress-theme/2661854\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/05/nh.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Nice hotel is a WordPress theme designed for hotels, hostels, resorts, spas and any other type of service which requires a booking type system.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/nice-hotel-wordpress-theme/2661854\">Purchase Nice Hotel theme</a></p>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=17r2Og6jT7A:Ft8g0qXcBzA:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=17r2Og6jT7A:Ft8g0qXcBzA:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=17r2Og6jT7A:Ft8g0qXcBzA:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=17r2Og6jT7A:Ft8g0qXcBzA:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=17r2Og6jT7A:Ft8g0qXcBzA:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=17r2Og6jT7A:Ft8g0qXcBzA:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/17r2Og6jT7A\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://wpml.org/2015/05/this-week-compatible-mh-magazine-lsx-loma-nice-hotel/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://wpml.org/2015/05/this-week-compatible-mh-magazine-lsx-loma-nice-hotel/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WPML representative speaking at WordPress MeetUp Cadiz, Spain\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/EkaDSwWzfic/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://wpml.org/2015/04/wpml-representative-speaking-at-wordpress-meetup-cadiz-spain/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 29 Apr 2015 10:02:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"https://wpml.org/?p=608606\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:341:\"This Thursday, April 30, Amit Kvint, from the WPML compatibility team  will lead a WooCoomerce and Multilingual related session at the WordPress MeetUp in Cadiz, Spain. If you live nearby join the MeetUp to listen and watch a live demo. If you don’t plan to attend, stay with us to find out why “Multilingual online stores” [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1954:\"<div id=\"attachment_608634\" style=\"width: 270px\" class=\"wp-caption alignright\"><img class=\"wp-image-608634 size-medium\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/04/profile_oct14-260x300.jpg\" alt=\"Amit Kvint\" width=\"260\" height=\"300\" /><p class=\"wp-caption-text\">Amit Kvint</p></div>\n<p>This Thursday, April 30, Amit Kvint, from the WPML compatibility team  will lead a WooCoomerce and Multilingual related session at the <a title=\"MeetUp Cadiz \" href=\"http://www.meetup.com/Cadiz-WordPress-Meetup/events/220947378/\" target=\"_blank\">WordPress MeetUp in Cadiz</a>, Spain.</p>\n<p>If you live nearby join the MeetUp to listen and watch a live demo. If you don’t plan to attend, stay with us to find out why “Multilingual online stores” is a hot topic these days.</p>\n<p>Este Jueves, 30 de Abril, Amit Kvint del equipo de compatibilidad de WPML va a dar una charla sobre WooCommerce Multilingual en el <a title=\"MeetUp Cadiz\" href=\"http://www.meetup.com/Cadiz-WordPress-Meetup/events/220947378/\" target=\"_blank\">WordPress MeetUp de la provincia de Cadiz</a>.</p>\n<p>Si estás cerca ven, participa y verás la demostración. Puedes seguir aquí las novedades acerca de cómo crear tiendas usando WooCommerce Multilingual</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=EkaDSwWzfic:27JS8KAp6-8:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=EkaDSwWzfic:27JS8KAp6-8:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=EkaDSwWzfic:27JS8KAp6-8:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=EkaDSwWzfic:27JS8KAp6-8:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=EkaDSwWzfic:27JS8KAp6-8:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=EkaDSwWzfic:27JS8KAp6-8:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/EkaDSwWzfic\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://wpml.org/2015/04/wpml-representative-speaking-at-