ata\";s:26:\"https://wpml.org/?p=606032\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:316:\"Today we are happy to announce that we have 3 themes and 1 plugin to add to our compatibility list. The themes are Everything, Cube, Foodie Pro, and the plugin is Business Directory If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Amit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5146:\"<p>Today we are happy to announce that we have 3 themes and 1 plugin to add to our compatibility list. The themes are <a title=\"Everything\" href=\"http://themeforest.net/item/everything-responsive-wordpress-theme/8661152\">Everything</a>, <a title=\"Cube\" href=\"http://themeforest.net/item/cube-multipurpose-simple-reviews-wordpress-magazine/7534092\">Cube</a>, <a title=\"Foodie Pro\" href=\"http://shaybocks.com/foodie/\">Foodie Pro</a>, and the plugin is <a title=\"Business Directory\" href=\"https://wordpress.org/plugins/business-directory-plugin/\">Business Directory</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title=\"Multilingual Ready Themes \" href=\"https://wpml.org/documentation/theme-compatibility/\">Multilingual Ready Themes</a></li>\n<li><a title=\"Multilingual Ready Plugins \" href=\"https://wpml.org/documentation/plugins-compatibility/\">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href=\"https://wpml.org/documentation/theme-compatibility/go-global-program/\">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title=\"Achieving WPML compatibility for your themes and plugins\" href=\"https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/\">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Everything theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/everything-responsive-wordpress-theme/8661152\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/04/everything.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Multipurpose responsive theme suitable for a variety of site types: creative portfolio, big corporate site, personal blog, product-oriented site, video &amp; photo album.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/everything-responsive-wordpress-theme/8661152\" target=\"_blank\">Purchase Everything theme</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Cube theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://themeforest.net/item/cube-multipurpose-simple-reviews-wordpress-magazine/7534092\"><img src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/04/cube.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Cube is an extremely easy to use Responsive Grid Multipurpose Magazine WordPress Theme, it adapts to any device(try resizing your browser), designed to present your news in a cool, minimal and creative way.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://themeforest.net/item/cube-multipurpose-simple-reviews-wordpress-magazine/7534092\">Purchase Cube theme</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Foodie Pro theme</h2>\n<p style=\"text-align: center;\"><a href=\"http://shaybocks.com/foodie/\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/04/foodie.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Foodie Pro is simple and elegant food blogging theme.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"http://shaybocks.com/foodie/\">Purchase Foodie Pro theme</a></p>\n</div>\n<div class=\"feature\">\n<h2 style=\"text-align: center;\">Business Directory plugin</h2>\n<p style=\"text-align: center;\"><a href=\"https://wordpress.org/plugins/business-directory-plugin/\"><img class=\"aligncenter size-full wp-image-340493\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/04/bd.png\" alt=\"ekho\" width=\"590\" height=\"300\" /></a></p>\n<blockquote><p>Adds the ability to put a directory listings on a WordPress site. Adds similar functionality as Yelp, Yellow Pages, or a provider listing directory.</p></blockquote>\n<p><a class=\"button download-button vt-p\" href=\"https://wordpress.org/plugins/business-directory-plugin/\">Download Business Directory plugin</a></p>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=UtbPM28clKo:DOFCrPfjThA:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=UtbPM28clKo:DOFCrPfjThA:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=UtbPM28clKo:DOFCrPfjThA:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=UtbPM28clKo:DOFCrPfjThA:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=UtbPM28clKo:DOFCrPfjThA:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=UtbPM28clKo:DOFCrPfjThA:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/UtbPM28clKo\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"https://wpml.org/2015/04/this-week-compatible-everything-cube-foodie-pro-business-directory/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://wpml.org/2015/04/this-week-compatible-everything-cube-foodie-pro-business-directory/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPML representative speaking at WordCamp Barcelona, Spain\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpml/~3/9NnK86yFxg4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://wpml.org/2015/04/wpml-representative-speaking-at-wordcamp-barcelona-spain/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 24 Apr 2015 07:15:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"https://wpml.org/?p=605277\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:331:\"This Saturday, April 25, a WPML representative will lead a WooCoomerce and Multilingual related session at WordCamp Barcelona in Spain. If you live nearby join WordCamp to listen and watch a live demo. If you don’t plan to attend, stay with us to find out why “Multilingual online stores” is a hot topic these days. [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Agnes Bury\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4903:\"<p><strong>This Saturday, April 25, a WPML representative will lead a WooCoomerce and Multilingual related session at <a href=\"http://barcelona.wordcamp.org/2015/\" target=\"_blank\">WordCamp Barcelona </a>in Spain. </strong></p>\n<p>If you live nearby join WordCamp to listen and watch a live demo. If you don’t plan to attend, stay with us to find out why “Multilingual online stores” is a hot topic these days.</p>\n<h2>About Bernat Torras</h2>\n<div id=\"attachment_290850\" style=\"width: 240px\" class=\"wp-caption alignleft\"><img class=\"size-medium wp-image-290850\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2013/11/BernatTorras_1-230x300.jpg\" alt=\"Bernat Torras\" width=\"230\" height=\"300\" /><p class=\"wp-caption-text\">Bernat Torras</p></div>\n<p><strong>Bernat Torras</strong> is currently working in the Quality Assurance Team testing WPML. In the past, he was involved in WooCommerce Multilingual plugin development and also worked as a WPML supporter.</p>\n<p class=\"clearfix\">Living in Catalonia, 45 minutes from Barcelona, he took the opportunity to apply as a speaker at the first WordCamp in this beautiful city. He was accepted and this Saturday is looking forward to impressing local WordPress fans with a short talk combined with a live demo!</p>\n<h2>About the session</h2>\n<p>Bernat&#8217;s session is entitled<strong> “Start selling globally! Building a multilingual e-commerce site.”</strong> It will be part of the <a href=\"http://barcelona.wordcamp.org/2015/programa/\" target=\"_blank\">event agenda</a> for Track A, on Saturday afternoon, at 4:30pm.</p>\n<div id=\"attachment_605292\" style=\"width: 710px\" class=\"wp-caption aligncenter\"><img class=\"size-full wp-image-605292\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/04/bernats-slides-woocommerce-multilingual.jpg\" alt=\"A cover slide coming from Bernat’s presentation\" width=\"700\" height=\"523\" /><p class=\"wp-caption-text\">A cover slide coming from Bernat’s presentation</p></div>\n<p>Bernat will start with a short theoretical part and will answer these two questions:</p>\n<ul>\n<li>Is WordPress good enough for e-commerce sites? (yep, we know there are other solutions as Magento, Prestashop, etc)</li>\n<li>Is it worthwhile to make your store multilingual?</li>\n</ul>\n<p><strong>Then he will run a demo.</strong> He has prepared a sample shop in his localhost running WooCommerce with some products.</p>\n<p>Bernat will demonstrate:</p>\n<ul>\n<li>how to setup WPML with a few languages,</li>\n<li>how to use the free WooCommerce Multilingual plugin to setup currencies (with formatting, and rounding options),</li>\n<li>how to translate products together with categories, attributes and custom fields,</li>\n<li>how the WooCommerce Multilingual plugin works with other third-parties plugins.</li>\n</ul>\n<h2>Why WooCommerce Multilingual related session are needed</h2>\n<p>Asked why sessions like this one are important to share during WordCamp events, Bernat explains:</p>\n<blockquote><p>“Here, in Barcelona, Spain, we live in a pretty multicultural and multilingual society. That’s why it is so important to make our websites and e-commerce stores multilingual as well.</p>\n<p>Anybody can expand their business globally by simply adding additional languages to their site. In my session I’ll help entrepreneurs, developers and site owners get a better idea of what is required providing best tools and live examples to achieve top results.”</p></blockquote>\n<h2>Who else is attending WordCamp Barcelona</h2>\n<div id=\"attachment_531703\" style=\"width: 150px\" class=\"wp-caption alignleft\"><img class=\"size-full wp-image-531703\" src=\"https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2014/12/Yvette_page-wpcf_140x138.jpg\" alt=\"Yvette Oliveau\" width=\"140\" height=\"138\" /><p class=\"wp-caption-text\">Yvette Oliveau</p></div>\n<p><strong>Yvette Oliveau</strong>, our excellent WPML Supporter, is also attending the event. Take this unique opportunity to get answers for all your WordPress and Multilingual related questions. Yvette together with Bernat will he happy to answer all your doubts. </p>\n<p><strong>See you on Saturday, in Barcelona!</strong></p>\n<div class=\"clearfix\"></div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.feedburner.com/~ff/wpml?a=9NnK86yFxg4:WpCu1dUahIg:D7DqB2pKExk\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=9NnK86yFxg4:WpCu1dUahIg:D7DqB2pKExk\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=9NnK86yFxg4:WpCu1dUahIg:gIN9vFwOqvQ\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=9NnK86yFxg4:WpCu1dUahIg:gIN9vFwOqvQ\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/wpml?a=9NnK86yFxg4:WpCu1dUahIg:V_sGLiPBpWU\"><img src=\"http://feeds.feedburner.com/~ff/wpml?i=9NnK86yFxg4:WpCu1dUahIg:V_sGLiPBpWU\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/wpml/~4/9NnK86yFxg4\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://wpml.org/2015/04/wpml-representative-speaking-at-wordcamp-barcelona-spain/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://wpml.org/2015/04/wpml-representative-speaking-at-wordcamp-barcelona-spain/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"hourly\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:2:{i:0;a